    public static getGBK(s: string): number[]{        
        var ret: number[] = new Array<number>();
        for (var i: number = 0; i < s.length; i++) {
            var tmp: number[] = StringConvert.gbk_wctomb(s.charCodeAt(i));
            for(var key in tmp)
                ret.push(tmp[key]);
        }
        ret.push(0);
        return ret;
    }

    private static gbk_wctomb(wc: number): number[] {
        var ret: number[] = new Array<number>();
        if (wc <= 0x7f) {
            ret.push(wc);
            return ret;
        }

        var index: number = 0;
        if (wc >= StringConvert.unicode[0])
            index = wc - StringConvert.unicode[0];
        if (index < StringConvert.unicode.length){            
            var ba = new ByteArray();
            ba.writeShort(StringConvert.gbkcode[index]);
            ba.position = 0;
            var high = ba.readUnsignedByte()                
            ret.push(ba.readUnsignedByte());
            ret.push(high);
            return ret;
        }
        
        for (var i: number = StringConvert.unicode.length - 1; i >= 0; i--) {
            if(StringConvert.unicode[i] == wc){
                var ba = new ByteArray();
                ba.writeShort(StringConvert.gbkcode[i]);
                ba.position = 0;
                var high = ba.readUnsignedByte()                
                ret.push(ba.readUnsignedByte());
                ret.push(high);
                return ret;
            }
        }
        console.log("gbk_wctomb " + wc);
        var ba = new ByteArray();
        ba.writeShort(wc);
        ba.position = 0;
        ret.push(ba.readUnsignedByte());
        ret.push(ba.readUnsignedByte());
        return ret;
    }

    public static getUtf8(gbk: number[]): string {
        var s: string = "";
        for (var key: number = 0; key < gbk.length;key++) {
            var c = gbk[key];
            if (c == 0)
                break;
            if (c <= 0x7F) {
                s = s + String.fromCharCode(c);
                continue;
            }
            var c = gbk[key + 1] + gbk[key] * 0x100;
            key++;
            var sTemp = String.fromCharCode(StringConvert.gbkmbtowc(c));            
            s = s + sTemp;
        }
        return s;
    }

    private static gbkmbtowc(gbkCode: number): number {          
        for (var i: number = 0; i < StringConvert.gbkcode.length; i++) {
            if (StringConvert.gbkcode[i] == gbkCode) {
                var retCode = StringConvert.unicode[i];                
                return retCode;
            }
        }
        console.log("gbkmbtowc " + gbkCode);
        return gbkCode;
    }
